import React, { useState } from 'react';
const Todo = ({addTodo})=>{
    const[value , setValue] = useState ('')

    const handleSubmit =(e) => {
        e.preventDefault();
        if (!value) return;
        addTodo(value);
        setValue ('')
    };
}




 export default Todo;
